        list5.add(new Compatibility("يبحث كلاهما على الشهرة ويتنافسان عليها، لا يوجد بينهما اتفقاق سوى على الصعيد العملي .. الرجل الأسد يعجب بالمرأة الجدي النشيطة والناجحة وصاحبة الارادة الصلبة، يحتاج بقائها وظهورها لتحقيق مصالح على الصعيد العملي، ظاهريا يبدو شخصا عاطفيا الا أنه  بارد القلب، هي من ترشده وتنصحه، أما هو فتزعجه ارشاداتها ونصائحها المستمرة فهو انسان متفائل، ويحتاج لامرأة تدللـه وتفتخر به مهما كان، يطمح دائما للبقاء لامعا متميزا .. الشيء الوحيد الذي يجمعهما هو طموحهما الغير منظم .. عمليا المرأة الجدي تهوى الرجل الأسد في البداية لكن مجرد شعورها بعدم حبه لها تبتعد عنه وتنفر منه، ولا يؤثر بها هذا الأمر كثيرا لأن عاطفتها ليست هي الأولوية في حياتها.",
                "80"));
        list5.add(new Compatibility("علاقة منسجمة على كافة الأصعدة، فهما ينجحان كصديقين وكحبيبين وأيضا كزوجين .. الرجل الأسد يمتلك قلبا دفاقا، ونبلا عظيما، وثباتا قويا، يعجب بشخصية المرأة الدلو القوية وينجذب اليها وهي امرأة تصلح لأن تكون ملكة برفقته تعزز له شعوره  بالفخر والاعتزاز .. المرأة الدلو تغرم  بشخصية الأسد القوية واللامعة، وتعجب بانفتاحه وعلاقاته الانسانية، تسحرها تصرفاته في الحب وهي سيدة أنيقة من الصعب مقاومتها، تقدم له الكثير من الاهتمام والحب والاخلاص، وتسعى لأن  تدهشه وتشعره بأنه لم ولن يصادف امرأة مثلها، وهو يكره أن يشعرها باعجابه بها لأنه يعد ذلك ضعفا.",
                "80"));
        list5.add(new Compatibility("علاقة سيئة، فهما يختلفان على كل شي، وينشغل كل منهما باهتماماته عن الاخر .. الرجل الأسد يهوى المرأة الحوت لكنه لا يستطيع أن يفهمها، حب الظهور لدى الأسد واهتمامه الكبير بنفسه يجعله ينشغل عنها كثيرا، فهو دائم الاهتمام بشؤونه وأموره الخاصة وكلمة \"أنا\" \"أنا\" هي السائدة على لسانه في جميع الأحوال، يفتش عن ظهوره ولمعانه الدائم وفي كافة الوسائل وهذا الأمر يزعج المرأة الحوت جدا مما  يؤدي لوقوع سوء التفاهم بينهما ..المرأة الحوت لا يمكنها أن تحب الرجل الأسد الذي يفضل السعي وراء المجد والشهرة على السعي  وراء حبها، هي تريد رجلا يحبها ويهتم بأمرها فقط ولا ينشغل عنها أبدا، تخاف من انتقاداته القاسية وغضبه اللا محدود .. على الرغم من اعجاب الرجل الأسد بالمرأة الحوت لكن سوء التفاهم  بينهما واقع لا محالة.",
                "80"));


        list6.add(new Compatibility("لشخصية المرأة الحمل قوة  تجعل رجل العذراء يقع في شباك حبها من أول نظرة على الرغم من شخصيته الجدية المحبة للعبوس التي تتناقض تماما مع شخصيتها المرحة الضحوكة الحنونة الا أنها هي الوحيدة القادرة على تغيير نمط حياته لو قليلا واخراجه من مربع الجدية السائد على حياته وفك تلك العقدة التي يحملها بين حاجبيه.",
                "80"));
        list6.add(new Compatibility("العلاقة بينهما منسجمة صالحة للزواج وناجحة في العمل المشترك .. المرأة الثور تؤدي دورها باتقان ، تظهر نفسها وقدراتها وما تملك من كفاءة في علاقتها العاطفية بهذا الرجل .. والرجل العذراء من أشد المعجبين بها، فيبهره حضورها الملفت والمقترن دائما بالمظهر الخلاّب الأنيق هو يحبها دون أية مقدمات ودون أن يطري على جمالها او يكتب فيها أشعارا.. يحبها بعقله وقلبه الى الأبد ولا يخونها ابدا.. هو يرى فيها المرأة المثالية الرائعة التي تفهمه وتحبه بحسناته وسيئاته..  يشعر بالاطمئنان اليها والراحة معها..  ان كلاهما يحتاج للاخر.. علاقتهما مثيرة هادئة يملأها الصبر الذكاء الحكمة والتناغم.",
                "80"));
        list6.add(new Compatibility("علاقة خالية من الانسجام والتوافق .. الرجل العذراء ينتقد المرأة الجوزاء لانفاقها ويوجه لومه لها لعدم تقديرها وتفهمها لطبيعته .. المرأة الجوزاء انسانة دبلوماسية لا تهتم للعلاقات الجادة الا اذا كانت تريد ذلك أما هو فعاطفي وغير دبلوماسي، ويصعب عليه أن يتفهم تصرفاتها المتقلبة، وعلى الرغم من كراهيته للأنانية لكنه يضحي ويتحمل من أجلها.",
                "80"));
        list6.add(new Compatibility("العلاقة بينهما متجانسة، يوجد فروقات واضحه لكن ليس من الصعب ايجاد تفاهم بينهما  ..المرأة السرطان تتنازل للرجل العذراء وتعفيه من العديد من المسؤوليات، تحب احتواء قلبه على الحنان الذي يبقيه الى جانب منزله وأطفاله، فتجذبه بجمالها الأنثوي ورقتها الناعمة، الرجل العذراء يطمئن لها ويشعر بالراحة في قربها، انه يجدها المرأة الكاملة.. لأنها امرأة حساسة وذكية وجميلة وكذلك ربة منزل ممتازة، تغرقه بحبها وحنانها وعطفها.. وتأخذه الى شاطىء الأمان معها .. علاقتهما تنجح  على الصعيد العملي وهي متكافئة على الصعيد العاطفي، ينسجمان معا ويجدان الحب والسعادة.",
                "80"));
        list6.add(new Compatibility("علاقة هادئة لكنها غير متناغمة، تبدأ بداية لطيفة لكنها تنتهي نهاية مأساوية وحزينة .. المرآة الأسد تجذب الرجل العذراء لها بما تمتلكه من حيوية، تعتقده شحص ضعيف وتستقوى عليه من أول لحظة، لا تعجبها انتقاداته وسخريته، دائما تحاربه وتثور عليه وتغضبه، ولا تهمها مشاعره وأحاسيسه مهما كانت .. الرجل العذراء يبذل كل ما بوسعه لأرضاءها وابقائها بقربه، الا أنه يلاحظ أنانيتها وحبها للتفاخر بنفسها. يكرس جميع طاقاته ليكون الرجل الذي تريد لكنه يكتشف بأنه ضحية لها.",
                "80"));
        list6.add(new Compatibility("علاقتهما متوقفة على الرغبة والنضوج على الصعيدين الفكري والعاطفي .. المرأة العذراء لن تحتاج الى تبرير كل ما تقوم به لهذا الرجل لأنه يستوعبها ويفهمها جيدا، وهي بالمقابل انسانة ذكية تعرف تماما كيف ترضيه .. الرجل العذراء يحترم هذه المرأة ويقدرها كثيرا، ويقف بجانبها فهو يستمتع بعلاقتهما معا، ويشعر بالحب المتبادل بينهما،  بامكان هذا الرجل تخطي الأمور البسيطة حتى يجعل علاقتهما ممكنة اذا رغب بذلك .. انها علاقة ناجحة  لكن بشرط أن لا ينغلق كل منهما على نفسه.",
                "80"));
        list6.add(new Compatibility("علاقتهما مستحيلة، الانجذاب بينهما مؤقت .. الرجل العذراء انسان صادق وصريح مع هذه المرأة، يرى أنها تملك مزايا رائعة لكنها بالمقابل تملك وجهان متناقضان لذلك لا يستطيع أن يتقبلها أو يتفق معها .. المرأة الميزان سيدة جذابة وساحرة، لكنها تشعر بالملل من سذاجة العذراء، اهتماماتهما مختلفة عن اهتماماته، وتنتقده كما ينتقدها، لذلك لا يمكنهما الانسجام معا.",
                "80"));
        list6.add(new Compatibility("العلاقة منسجمة، يتفقان بالكثير من المجالات .. الرجل العذراء ينجذب لها لكنه يحذر منها بالوقت نفسه، يرتاح اليها لقدرتها على تفهم أفكاره، ويسعد بعاطفتها وأحاسيسها .. المرآة العقرب بارعة في تقديم الراحة له وابعاده عن كل ما يزعجه، يعجبها فيه ابتعاده عن استخدام الأساليب الخبيثة لتحقيق ما يريد، كلاهما يفتش عن علاقة صادقة وغير عابرة.",
                "80"));
        list6.add(new Compatibility("العلاقة قد تنجح وقد تكون محدودة .. الرجل العذراء يحب حيوية هذه المرأة الا أنه ينزعج من نقها، ولا يحب سماع توجيهاتها فيوجه لها بالمقابل المواعظ التي تشعل غضبها .. المرأة القوس يجذبها الرجل العذراء لكنها تكره بروده الذي تكتشفه بسرعة، وترفض انتقاداته .. اذا توفر الوعي في هذه العلاقة من الممكن أن تنجح.",
                "80"));
        list6.add(new Compatibility("العلاقة منسجمة وثابتة، يوجد بينهما تشابه، فيجمعهما حب الظهور ومخالطة أصحاب المستويات الرفيعة .. الرجل العذراء ينجذب لهذه المرأة، لكنه يخشى كونها امرأة غير جدية، يعجبه مشاركتها اهتماماته العملية، ويجعله هذا متعلقا بها أكثر، يشعر بأهميتها في حياته ويقدر لها ذلك .. المرأة الجدي تعجب بالرجل العذراء لما يمتلك من ذكاء، صفاء روح، حكمة، أناقة، جاذبية، ولطف، لا يقلقها أبدا عدم تحدثه عن مشاعره تجاهها لأنه مثلها يهتم بالعمل كثيرا ويرهق نفسه فيه، فكليهما يعطي للعمل الأولوية، هو بنظرها انسان صادق ملتزم بقول الحقيقة برغم مظهره البارد .. الخلافات بينهما تذهب بسرعة ولا تهدد استمرار علاقتهما المتميزة بالثبات.",
                "80"));
        list6.add(new Compatibility("علاقتهما هادئة، يمكنهما تحقيق النجاح والانسجام .. الرجل العذراء ينجذب لأفكار هذه المرأة المتميزة اللامعة والمستقلة، لديه حسن التنظيم الذي ليس لديها، مشاغلهما الحياتية تبعدهما عن الاهتمام بتفاصيل حياتهما الخاصة، كلاهما لا يمتلك الرومانسية .. المرأة الدلو تدرك كيف تجذب الرجل العذراء اليها، لا تنزعج من بروده لأنها مثله، تعجب بكرمه وتطوعه المستمر لتقديم المساعدة، تقدر ما لديه من ذكاء، وروح صافية، وحكمة مميزة، فتتعامل معه بحكمة .. من الممكن نجاح هذه العلاقة  اذا تشاركا القيام بنشاطات أو أعمال، لأن أفكارهما وطريقة معيشتهما غير متشابهة ومن الممكن لهذا أن يجمعهما، عليهما الابتعاد عن توجيه الانتقادات لبعضهما البعض، الصداقة هي أجمل ما يلتقيان فيه.",
                "80"));
        list6.add(new Compatibility("علاقتهما جميلة ورائعة، لا يوجد بينهما أي صراع أو تصادم بالرغم من اختلاف طباعهما، الحب موجود لكنه يأخذ وقتا حتى يتقبل كل منهما الآخر ويتفهم شخصيته، الا أن النهاية تكون سعيدة لكليهما، الرجل العذراء انسان واعي وحازم يوجه انتقاداته للمرأة الحوت بسبب عالمها المليء بالأحلام،  لكنه وبرغم أي شيء معجب بها كثيرا، عندما ينتقدها تشعر بالحزن الا أنها لا تحقد عليه، تسامحه وتعامله معاملة حسنة، تشاركه قلقه الدائم على نفسه وصحته وأمراضه الوهمية، يقدم واجباته تجاهها على أكمل وجه، وفي المقابل تقدم هي له الاهتمام والمحبة، في البداية يبدو التفاهم بينهما صعبا لكن اذا تحليا بالصبر قليلا يمكنهما تحقيق الصداقة والحب والاهتمام معا .. المرأة الحوت انسانة حالمة، تحلم بأمير يمسكها من يديها ويخرجها من الضياع الذي تعيشه ويجد لها حلولا لكل مشاكلها ويغمرها بالحب والحنان .. علاقتهما قوية تنتهي بزواج سعيد ومزدهر.",
                "80"));

        list7.add(new Compatibility("العلاقة غير هادئة، كلاهما يحاول السيطرة على الآخر الرجل الميزان  يتفهم طبيعة المرأة الميزان العقرب المسيطرة، تجذبه قوتها ومحاولتها للسيطرة عليه  الا انه لا يتجاوب معها، المرأة العقرب يسعدها هدوء الرجل الميزان وتتأثر به، تعرف كيف تجذبه وتفتنه، تحاول هي ان تكون هي من قرر الانفصال والابتعاد لأنها تشك في نجاح العلاقة التحدي والسيطرة يعرقلا نجاح العلاقة.",
                "80"));
        list7.add(new Compatibility("العلاقة منسجمة وجميلة الرجل الميزان  يميل الى المرأة القوس، حبها للمناقشة واثارة الجدل يجذبه اليها، يجد فيها كل المزايا الجميلة، المرأة القوس تشعر بالحنان نحو الرجل الميزان وتبادله حماسه وحبه للمغامرات والسفر تحاول ان تبدد ما يقلقه وتساعده على الاستقرار، متفائلة انيقة واثقة من نفسها الا انها مترددة امام فكرة الزواج ولا تتقبله بسهولة وتفضل حريتها الى ان تشعر بحب جارف وانجذاب قوي.",
                "80"));
        list7.add(new Compatibility("العلاقة غير هادئة، لا يتفقان في اي مجال من مجالات الحياة، الرجل الميزان يعتبر هذه  المرأة معقدة ولا يحب جديتها الزائدة ولا ثباتها الدائم الذي يصفه بالروتين، ويبعث فيه الملل، يحاول جذبها وإرضاءها لكن عبثا فهي لا تهتم بالشكليات والمظاهر الجميلة بل تبحث عن العمق والواقعية المرأة الجدي تتهم الرجل الميزان بالسطحية لأنها ليست مثله، وتواجه صعوبة في تحمل سذاجته، تلاحظ  أساليبه الخداعة ولا تحاول جذبه او اسره لانه لا يعجبها، العلاقة لا تدوم بينهما، فهو يهتم بالمظهر وهي تهتم بالجوهر وما بين المظهر والجوهر فوارق كبيرة وكثيرة تباعد ولا تقرب.",
                "80"));
        list7.add(new Compatibility("العلاقة رائعة ومنسجمة، يتفهمان حاجات ورغبات بعضهما، العلاقة دافئة ومثيرة الرجل الميزان يحترم افكار المرأة الدلو ويقدر قراراتها، يروق له جمالها الناعم والهادئ وأنوثتها الطاغية، كلاهما اجتماعيان ومتقلبا المزاج، الرجل الميزان وُلد ليتزوج وهي تصر على  تثبيت قواعد هذا الزواج على اسس الصداقة، المرأة الدلو تعرف كيف تقدم للرجل الميزان الشجاعة وصوابية القرار الذي يفتقرهما، تجده ساحرا، أكثر ما يشدها للعلاقة معه هو تركه لها الحرية والاستقلال.",
                "80"));
        list7.add(new Compatibility("قد يتفقان في امور عديدة لكنهما يختلفان ايضا في امور لا تقل اهمية، الرجل الميزان  يرتاح الى المرأة الحوت لأنها ناعمة ولا تثير المشاكل وتحسن معاملته بلطف، يعرف انها تفعل ذلك لمحاولة إمتلاكه وحبسه في عالمها لكنه يعرقل كل محاولاتها لأنه لا يمكن ان يحصر كل اهتمامه بها فقط، فهو يميل الى الجنس اللطيف ولا يستغني عنه، عندما يتكلم بوضوح ويعبر عن آرائه يجرحها دون ان يشعر، المرأة الحوت لا تشعر بالسعادة مع الرجل الميزان، ستغرم به لما  يظهره من أناقة في التعامل معها ولما يعطيها من اهتمام وحب وحنان، تتألم عندما لا يبادلها محاولاتها من  اجل اقامة علاقة دائمة، العلاقة ليست سيئة جدا بإمكانهما ان يتفقا ولا داعي لإثارة المشاكل.",
                "80"));
        list7.add(new Compatibility("علاقة متكاملة،  يتفاهمان وينجحان في الحب والحياة العائلية الرجل الميزان عاقل متزن وينجذب للمرأة الحمل لجمالها واناقتها، يعجبه ذكاءها وشخصيتها وفلسفتها للأمور، واثقة من نفسها، يعبر لها عن حبه ويتوق للزواج منها فهي المرأة الكاملة في نظره، يؤسسا بيتا سعيدا المرأة الحمل مغرمة بأناقة الرجل الميزان ولياقته واسلوبه الرومانسي في الحب واهتمامه بتفاصيل حياتها، تستطيع اسره في حبها وعالمها وتمنحه الحرية من وقت لآخر ليعود اليها أكثر شوقا.",
                "80"));
        list7.add(new Compatibility("علاقة جميلة وناجحة ينجذبان الى بعضهما،  يتفاهمان ويتآلفان،  يواجهان الحياة بثبات، الرجل الميزان يجدها امرأة جميلة وواثقة من نفسها، قوية ناعمة حكيمة وصبورة، يبدأ معها بعرقة عابرة لكنها تحول الى علاقة متينة فزواج، يعرف كيف يكسب قلبها ويبرع في القاء الاشعار عليها، تشعر معه كأنها ملكة، يتباهى بها امام اهله، هذا الرجل لن تجدي مثله بين الرجال، فهو جذاب وساحر، يحرك فيها مشاعر الغيرة والحب، يحبها بأخلاص، ومعه شتشعر بانها المرأة التي تمتلك قلبه والعالم المرأة الثور تنجذب الى الرجل الميزان وتغار عليه من المعجبات وتغفر له اخطائه، تهبه الحب والاهتمام وتستحوذ على قلبه بذكاء ورقة ورومانسية، تحس معه بالأمان والتوازن.",
                "80"));
        list7.add(new Compatibility("علاقة رائعة اساها الاعجاب والحب، إنسجام وتآلف، إستقرار وحياة مفعمة بالحيوية، الرجل الميزان يرتبط بالجوزاء بسبب الحب  والاعجاب الذي  يغمر قلبه، يخلص لها فكريا وعمليا مع انه باستطاعته  إقامة علاقات كثيرة فهو محبوب عند النساء المرأة الجوزاء ذات  انوثة صارخة، ذكية  وطيبة القلب، تتفانى في سبيل سعادة الرجل الميزان الذي تحب، تخصه بعناية  خاصة وتحرص على راحته، تغارعليه وتحبه وهو افضل صديق وحبيب لها وهو يحتاج اليها والا احس بالضياع، يحتاج الى افكارها الايجابية ويغار عليها بجنون لكنه مطمئن البال لأنها انثى اصيلة، هو على استعداد للحاق بها اينما كانت. ",
                "80"));
        list7.add(new Compatibility("العلاقة متناقضة، لا اتفاق ولا تفاهم بين البرجين والاعجاب لا يدوم الرجل الميزان لا يتفهمها بسهولة الا انه يكشف فيها احساسا مرهفا يشبه احساسه تعجبه بتواضعها وجاذبيتها لكنه يجدها مزاجية متقلبة ولا تستقر على حال فيجد نفسع غير قادر على تحمل تقلباتها المرأة السرطان تلفت نظره ويمكنها ان تجذبه  ولكن بعد جهود مستمرة، تجذبها شخصيته لكنها لا تشعر معه بالامان والاستقرار.",
                "80"));
        list7.add(new Compatibility("انسجام وتفاهم من الطرفين، الرضى يسيطر على العلاقة الرجل الميزان فخور بهذه المرأة الانيقة الجميلة الحيوية، يتفهم شخصيتها القوية، تدير مملكتها ولا يعترض على القوانين التي تفرضها في بيتها، المرآة الأسد  يجذبها الرجل الميزان المرهف الاحاسيس، اسرها هذا الرجل وتعتبره افضل صديق لها.",
                "80"));
        list7.add(new Compatibility("علاقة فاترة وغير متكاملة الرجل الميزان  تسحره المرأة العذراء برقتها وبساطتها ونعومتها لكنها ليست ربة البيت الممتازه التي يحلم بها، المرأة العذراء باردة قليلة التعبير عن مشاعرها وكثيرة الانتقاد والتحليل وتعتبر نفسها اذكى من هذا الرجل، عليهما ان يحترما بعضهما ويحسنا تصرفاتهما ان ارادا انجاح العلاقة.",
                "80"));
        list7.add(new Compatibility("العلاقة متناغمة ومتآلفة ومنسجمة  المرآة الميزان  تجذب الرجل الميزان بجمالها واناقتها بسرعة ويقع في سحر غرامها، لا تحاول  ان تسخر من رومنطقيته معها، الرجل الميزان يؤثر عليها بابتسامته السحرية، يعاملها\n" +
                "بلباقة وتهذيب ليكسب محبتها وقلبها وينجح في ذلك ولا يحاول خداعها يتقاسمان التفاهم وحسن التناغم.\n" +
                "\n",
                "80"));

        list8.add(new Compatibility("تجذب المرأة الحمل رجل العقرب بشخصيتها القوية وعلى الرغم مما يتمتع به العقرب من معدن طيب وارادة صلبة وقدرة الا أن أنانيته وغموضه وأساليبه الملتوية وشخصيته الانتقامية بالاضافة الى حبه  للسيطرة تنفر المرأة الحمل منه وتجعلها تخشى الاقتراب من دائرته المليئة بالخطر على شخصيتها واستقلالها فتصده اذا ما حاول المصارحة بحبه لها فهي لن تتخلى عن اي شيء من أجله فلن تضمن لسعته السامة اذا ما أراد الانتقام.",
                "80"));
        list8.add(new Compatibility("علاقتهما متكافئة يسودها الانجذاب والثقة والحب .. المرأة الثور تقدر الرجل العقرب وتحترمه فتحاول التفاهم معه دون تغييره،  هي تتقبله على حاله وتظهر له آلامها لتجذب اهتمامه.. تجده حساسا وعاطفيا من الداخل على عكس ما يظهره من البرودة .. تمنحه اهتماما وحبا نادرين، أما الرجل العقرب فتجذبه أنوثتها وأناقتها، وتلفت نظره كربة بيت رائعة مما يجعله يشعر بالراحة والدف، يحبها كثيرا ويغار عليها، يسكن معها في عالم يمتلأ بالعاطفة الا انه ينتقدها أحيانا بشدة ويتشاجر معها بسبب غيرته الشديدة .. هي المرأة التي يحلم بها وبالفعل  ويفعل المستحيل من أجل الزواج بها .. يجب عليها أن تمتلك الصبر الصدق الصراحة وتستخدم الملاطفة معه وهذه الفنون تبرع  المرأة الثور فيها.",
                "80"));
        list8.add(new Compatibility("علاقتهما صعبة جدا، يجسد كلاهما القطبين المتضادين، ولهذا السبب من الطبيعي عدم وجود ثقة تجمعهما، العلاقة مشتعلة وهناك خلافات على كافة الأصعدة .. الرجل العقرب يبذل كل ما في وسعه ويستخدم كل ما لديه من قوة ليسيطر عليها ويخضعها له لكنه يواجه صعوبات كبيرة فهي شخصية قوية وذكية وبامكانها التغلب عليه بسهولة، ينجذب هو لطبيعتها الرقيقة الرومانسية ولكنه ينفر من مظهرها الارتجالي، أما هي فلا يعجبها العقرب ولا تبذل أي محاولة  مهما كانت صغيرة لتفهمه أو تحبه، المرأة الجوزاء تسلك أسهل وأقصر الطرق المستقيمة لتصل الى أهدافها أما الرجل العقرب فيحب أن يسلك الطرق الملتوية ويبقى في محاولات مستمرة للسيطرة عليها لكنها تفعل كما يفعل بشكل مضاعف محاولة اغاظته وينزعج هو من تصرفاتها وأخذها حرية مبالغة فيها.",
                "80"));
        list8.add(new Compatibility("علاقة تقوم على التفاهم والانسجام والتآلف العاطفي .. المرأة السرطان سعيدة بعلاقتها معه فهو يحبها بجنون ويشعرها بحبه بطريقة رومانسية، هي تعتبره سيدها وآمرها وكذلك زوجها الهائم بحبها، وهذا كله بالنسبة لها كفيل بمحي سيئاته .. الرجل العقرب يرى نفسه سيدا في هذه العلاقة، يعتبرها ملائمة له كزوجة وحبيبة وقد يغضب عليها أحيانا بشدة لكنها لا تهتم  لذلك لأنها تعرف أنه انسان طيب القلب وحنون، يحب طاعتها له ويرى أنها تمتلك مميزات حسنة كثيرة .. يتمتعان معا بحياة رائعة وسعيدة ورومانسية تحت ضوء القمر.",
                "80"));
        list8.add(new Compatibility("علاقتهما غير منسجمة أبدا وتفتقر الى الحب والتضحية والتفاهم.. يوجد بينهما صراع من أجل السلطة والسيطرة .. المرأة الأسد تعتبر الرجل العقرب خصم عنيد وقوي، لذلك تكون حذرة جدا مما يضمره في داخله .. أما هو فينجذب اليها الا أنه يتصادم معها لأنها تواجهه وتتحداه بأستمرار، ولا يعجبه هذا الرجل أن تتحداه أي امرأة، فيخدعها ويغدر بها.",
                "80"));
        list8.add(new Compatibility("علاقتهما هادئة، كلاهما يحترم الاخر ويقدر ما يمتلكه من مزايا .. المرأة العذراء تفهم هذا الرجل لذلك تبقى حذرة منه، ولا تمنحه الثقة الكاملة، ولا تعطيه المجال للسيطرة عليها، توهمه بأنها تنفذ له ما يرغب، لكنها تنفذ ما ترغب هي به، بل وتجعله ينفذ لها ما تريد دون أن يشعر  بهذا .. الرجل العقرب يميل لهذه المرأة وما تمتلكه من مزايا حميدة ويشعر بالغيرة عليها، انه يحترمها، يحبها، يثق بها، ويرغب بتتويج علاقتهما بالارتباط، الا أنها لا تمنحه الرومانسية الكافية، وهذا ما يدفعة للفرار منها.. نجاح هذه العلاقة ممكنا ان رغبا بذلك.",
                "80"));
        list8.add(new Compatibility("يوجد بينهما اختلافات واضحة، هي امرأة رقيقة ومتزنة أما هو فمسيطر وقاسي .. المرأة الميزان  تعرف أن الرجل العقرب يحبها لجمالها فقط، لذلك تكون باردة،  وانها لا تستطيع أن تنسجم معه لأنه شخص متقلب المزاج، وعصبي ينفعل بسرعة ويرغب بامتلاكها والسيطرة عليها لاعجابه بجمالها، هي تشعر معه بأنها مجروحة من الداخل، وهو لا يعترف بأخطائه أبدا .. علاقتهما فاشلة ويسيطرعليها الصراع بهدف السيطرة.",
                "80"));
        list8.add(new Compatibility("علاقتهما متينة وهادئة، بامكانهما تأسيس بيت سعيد ومزدهر، كلاهما يسعى للامتلاك، وكلاهما يعشق بجنون، يحبان الحصول على الاستقرار والحب والاخلاص .. يضحيان لاسعاد بعضهما البعض، ويحترم كل منهما الاخر، ويفهمان الحب على أسلوبهما التعبيري والجسدي .. اذا قام الرجل العقرب بمحاولة خيانة المرأة العقرب ستنتقم منه وستثأر لكرامتها ولن تكترث بالنتائج .. كلاهما غيور لذلك من الأفضل لهما الابتعاد عن كل شيء يمكن أن يوقع بينهما.",
                "80"));
        list8.add(new Compatibility("ا يوجد أي انسجام أو تناغم بينهما، انجذابهما سريع الزوال .. فمثلا الرجل العقرب ينجذب للمرأة  القوس الا أنه لا يتقبل عشقها للحرية الزائدة وقوتها الكبيرة التي تمنعه من أن يتحكم بها .. المرأة القوس يجذبها الرجل العقرب لكنها لا تقبل تحكمه بها، فتنتقده كثيرا ولا تتفق معه اطلاقا.",
                "80"));
        list8.add(new Compatibility("في هذه العلاقة سر دفين وعميق، من الصعب على أحد معرفته، ترى هل هو انجذاب أم اعجاب، أم شجاعة، أم صلابة أم القوة أم كافة هذه الاشياء مجتمعة؟؟، الرجل العقرب يدرك كيف يحترم المرأة الجدي ويقدر قيمتها، لكنه يحلم بأن تظهر له لو القليل من كلام الغزل والهيام، يحب التدليل كثيرا، ويصر على يكون محبوبا لديها لكنه لا يستطيع ذلك، ويتجنب انفجار الأوضاع بينهما .. أما المرأة الجدي فهي امراة  فولاذية لا تهمها المشاعر أو الاحاسيس العاطفية مثل الرجل العقرب، تعلم كيف تقدره وتحترمه، تشاركه بعض الاشياء لكن بحذر، أسراره توترها وميولاته العاطفية تجعلها تخاف .. انهما ثنائي ناجح وطموح ومجتهد في العمل، يواجهان العقبات معا، ارادتهما قوية، يُخشى أن يتصادما، الضعف والحاجة شعوران لا يتواجدان عند أي أحد منهما  أمام الاخر .. ولعله هذا كان هو سر التجاذب واستمرار العلاقة بينهما.",
                "80"));
        list8.add(new Compatibility("العلاقة صعبة، لا يمكن لأحد منهما التغلب على الآخر .. يعتبر الرجل العقرب هذه المرأة صعبة الافكار والتصرفات، يزعجه عدم مقدرته التحكم بها وجعلها تقوم بتوفير كل رغباته، لا يتفق مع هذا المرأة،  ولا يجدها الانسانة المناسبة له، انها قوية مندفعة صامتة عنيدة وأيضا مستقلة، لا تقبل النظر اليه كبطل .. بامكان المرأة الدلو ان تحتجز هذا الرجل كأسير عندها اذا استخدمت معه الاسلوب اللطيف، هذه المراة مستقلة بطبيعتها، وتملك غموضا يجذب اليها الرجل العقرب، تبدي اعجابا بشخصيته لكنها تكون شديدة الحذر بالتعامل معه، ليقينها بأنه يخفي تحت مظهره الصامت والهادىء قوة كبيرة قابلة للأنفجار في أي وقت.",
                "80"));
        list8.add(new Compatibility("تجاذب سريع يقع  بين هذين البرجين، يوجد انسجام، تآلف، تفاهم، وكذلك هناك رغبة قوية لدى كليهما لتتويج هذه العلاقة بنهاية جميلة وسعيدة .. الرجل العقرب يحاول دائما امتلاك المرأة الحوت ويكون واثقا من أنها ستوافق على ذلك، فهي امراة ترغب في ان يتم امتلاكها من قبل من تحب، وقد تشكل هذه الصفة لديها عنصر من أهم عناصر النجاح لعلاقتهما، قد يظهر أحيانا غيرة قوية عليها الا أنه قلما يشكك بها، يوجد تجاوب سريع بينهما ينتهي بالزواج السعيد .. المرأة الحوت تنبهر بشخصية الرجل العقرب القوية والواثقة، وتكاد هذه المرأة أن  تكون الانسانة الوحيدة التي تكتشف الجانب الهادئ والرقيق في شخصيته، أحيانا يصيبها اليأس منه، وتحتاج لمن يدعمها ويعطيها ثقة بنفسها، فهي تستمد القوة من هذا الرجل، تكون معه متسامحة جدا، لا تتأفف من تسلطه ومتطلباته وهذا يجعل شراسته الطبيعية تنعكس معها إلى وداعة ولطف كبيرين دون سائر النساء.",
                "80"));

        list9.add(new Compatibility("علاقة  رائعة تحمل الكثير من القواسم المشتركة فكلاهما يسير على نفس الخط يحبان المغامرة والمرح ويكرهان اللف والدوران يتخذان قراراتهما معا ويتفاهمان على تفاصيل حياتهما سويا ويعرف عن القوس خاصة الاستقامة والصدق الا أنه مراوغ ذكي وهو ما تحبه امرأة الحمل كثيرا ويستطيع بصفاته هذه ايقاع امرأة الحمل في هيامه .. يحاول أحيانا اثارة غيرتها حتى يعلقها به أكثر ولا يظهر لها كل حبه حتى لا تظنه ضعيفا فيخسرها.",
                "80"));
        list9.add(new Compatibility("العلاقة بينهما محدودة، لا يوجد تناغم ولا تآلف، فكل منهما يمشي في طريق مختلف عن الآخر .. المرأة الثور تحب الرجل القوس وتنجذب اليه لكن عدم الاستقرار الذي يعيشه يعذبها، فهو يحب المرأة الواثقة من نفسها، التي تشعره برجولته وبأنه بطلها الذي يحميها.. على المرأة الثور أن تشعره باحتياجها اليه في حياتها، انه رجل رومانسي ولكنه منطقي كل ما يلزمها هو المعرفة بالأسلوب الذي سيوصلها الى أعماقه، انه الزوج الذي تحلم به جميع النساء ولن يخجل من اظهار حبه وتعلقه بها أمام عائلته وأصدقائه ولن يتوقف ولو للحظة عن حبها.",
                "80"));
        list9.add(new Compatibility("علاقتهما تقوم على التفاهم والانسجام، فأطباعهما متشابهة، يتعاونان وينجحان على كافة الأصعدة ..المرأة الجوزاء تحب كل جديد وهو يفتش عن كل مجهول، كلاهما واقعيان ويتصرفان بعقلية محنكة وذكاء مدهش، كلاهما أيضا متحرر ومرح، يتفقان في كل شيء ولا يختلفان، مشاغلهما الكثيرة تحيي فيهما  الحب والرغبة بالاجتماع السريع .. هي تسعد معه وتجد فيه خير الصديق والزوج وهو يعجب بشخصيتها ودهائها وبراعتها في مجالات الحياة عامة، ويجدها الزوجة المتفهمة وفتاة الاحلام المنتظرة.. العلاقة بينهما مثيرة ومليئة بالمغامرات.",
                "80"));
        list9.add(new Compatibility("ا يوجد أي تفاهم أو اتفاق في هذه العلاقة الا أنه يحدث اعجاب أولي بينهما .. المرأة السرطان يعجبها رجل القوس وتحاول السيطرة عليه باستخدام مميزاتها الأنثوية .. أما هو فينجذب إليها ويحبها لكنه لا ينسجم معها ويحاول أن يتهرب منها وفي كثير من الأحيان تسبب له الغضب الشديد والجرح بسبب أسلوبها وطريقة معاملتها التي لا يعجب بهما على الاطلاق .. علاقتهما تفتقر لروح التفاهم والتنازل والاستعداد للتضحية.",
                "80"));
        list9.add(new Compatibility("العلاقة متجانسة، يحملان طباع متطابقة .. المرأة الأسد تقوم بتنفيذ مشاريع كبيرة وضخمة مع الرجل القوس وتتبع خطاه بفرح ورغبة كاملة ولا تتردد أبدا بمرافقته أينما ذهب حتى لو قرر السفر الى اخر الدنيا، تمنحه ثقتها الكلية وتحمل له بداخلها حبا شديدا ومشاعر قوية، تغار عليه كثيرا، تتذمر أحيانا لكنها لا تفرط أبدا بعلاقتها معه، لا تتردد بالتنازل عن بعض الأمور الغير أساسية من أجله .. الرجل القوس ينتظر منها المبادرة، ويعطيها مساحة كافية للتعبير عن نفسها، ويمنحها الشعور بالراحة وحرية التحرك والتصرف.. يعجبه ذكاءها وتجذبه أناقتها فيغرم بها، علاقتهما ناجحة، يتوحدان في مواجهة الصعوبات.",
                "80"));
        list9.add(new Compatibility("علاقتهما غير منسجمة،.. المرأة العذراء تنجذب للرجل القوس لكنها لا تتفق ولا تتفاهم معه، فهي تجده مرحا لا يأخذ الأمور بالجدية الكافية والكفيلة لاقامة علاقة، تعتقد بأنها أكثر واقعية وجدية منه، تفكر مرارا قبل أن تقرر الارتباط به .. أما الرجل القوس فلا ترضيه العذراء على الصعيد العاطفي لذلك لا تستطيع أن تدخل قلبه أو تمتلك عواطفه.. ان أرادا النجاح عليهما تقديم التضحيات والسعي لايجاد لغة تفاهم مشتركة.",
                "80"));
        list9.add(new Compatibility("علاقتهما منسجمة، فهما يتشاركان الحياة معا بحلوها وبمرها .. المرآة الميزان  تغرم بالرجل القوس، وتبذل المستحيل لأسره في حبها، تدرك جيدا كيف تؤثر عليه، وتعرف كيف تجذبه اليها، وهو لا يوقفها ولا يمنع تصرفاتها .. الرجل القوس يشعر بالانجذاب تجاه المرأة الميزان، معها يتذوق طعم الراحة، فهي الأنثى الوحيدة التي تستطيع أن تفهمه وتقدره، لذلك هو مستعد ليقوم بفعل أي شي من أجلها.",
                "80"));
        list9.add(new Compatibility("علاقتهما هادئة، ذو انسجام قليل، وانجذاب كثير، وتحتاج الى تقديم التضحيات .. المرأة العقرب يجذبها الرجل القوس الفاتن، وتدرك الطريقة الملائمة لجذبه الى عالمها، تحترمه كثيرا وتشعر الى جانبه بالسعادة،الا أن عدم رغبته بالاستقرار توترها وتقلقها، فتصبح غير قادرة على تحمله .. الرجل القوس يوفر لها كل ما تحتاج اليه ويمنحها الحب والحنان، هو رجل كريم لا يبخل عليها بشيء، يرغب بالاستقرار الا انه يكره الحد من حريته،علاقتهما فاترة.",
                "80"));
        list9.add(new Compatibility("علاقتهما متطورة، ينجحان على كافة الأصعدة معا، تمكنهما نواياهما الحسنة وصفاتهما الجميلة من تخطي كل العقبات والصعوبات .. علاقتهما منسجمة، يقعان في حب بعضهما البعض، ويتشاركان الحياة سويا بحلوها وبمرها، وهما اجتماعيان ومنفتحان وكذلك واضحان.",
                "80"));
        list9.add(new Compatibility("علاقتهما صعبة جدا والاتفاق بينهما أصعب .. الرجل القوس يريد من المرأة الجدي الاتكال على نفسها في الجانبين الاقتصادي والمعنوي، لأنه يكره تحمل المسؤولية، وقد يؤدي هذا الى شعور القوس بالإهمال ، لكنه الرجل المحب للمغامرات العاشق للحياة، هو شخص متفائل ويرغب باكتشاف الأشخاص والأشياء، ولا يحتمل أن يكون محدودا ضمن نطاق معين .. تتهم المرأة الجدي القوس بعدم المسؤولية لأنها لا تتمكن من فهم مزاجه أو تقبل طبعه الناري، تواجه صعوبة كبيرة في فهم فلسفته وأسلوبه الغريب،لا تستطيع الاتفاق معه ولا تهتم بجذبه، السعادة بينهما غير موجودة.",
                "80"));
        list9.add(new Compatibility("علاقتهما جميلة، هادئة، حيوية، وأيضا متفائلة  .. الرجل القوس يحترم المرأة الدلو ويقدرها، وهو شخص صريح ومستقيم، يتصرف بأسلوب مرح، ويستخدم السخرية فهو معروف بحبه الكبير للمزاح، انه يشببها كثيرا في العديد من النواحي، أولها حب كليهما للحرية والاستقلال، وما يحببه فيها أكثر تمسكها بصداقته وثقتها التامة به .. أما المرأة الدلو فهي معجبة كثيرا بالرجل القوس ولا يمكنها مقاومة لطفه وسحره، تبالي لأمره كثيرا وتهمها سعادته، يهوى كلاهما السفر والتنقل والتغيير كما أنهما سريعا الغضب والضحك.",
                "80"));
        list9.add(new Compatibility("العلاقة صعبة، فالاختلافات والتناقضات بينهما كثيرة، لا يتفقا في أي مجال، وكل واحد منهما يعيش في عالم مختلف عن عالم الآخر بشكل جذري، وما يدعو للعجب امتلاك الاثنين للرومنطيقية والخيال الا أنهما لا يتفقا عاطفيا أبدا .. الرجل القوس يواجه صعوبة في التفاهم مع هذه المرأة، فمن الصعب الوصول الى شخصيتها الداخلية ، أما المرأة الحوت فتتوقع من الرجل القوس أن يقوم بحملها الى عالم مليء ومفعم، لكنها تيأس وتبحث عن من يعزز ثقتها بنفسها، فهي تأخذ القوة وتستمدها منه عن طريق الحب والرومنطقية والأحلام، الا أنها تتصادم مع سخريته المستمرة لها بسبب أفكارها وطيرانها في عالم الخيال والأوهام، فتواجه هذه السخرية بعاصفة هوجاء .. بامكانها الغوص في الأعماق والرحيل بعيدا عنه .. العلاقة بينهما مستحيلة منذ البداية، وعلى كل منهما تجنب الآخر.",
                "80"));

        list10.add(new Compatibility("علاقتهما صعبة الاستمرار على الرغم من امتلاك الجدي الشخصية الهادئة  التي قد تتناسب مع الشخصية الانفعالية التي تملكها امرأة الحمل الا أن جل اهتمامه ينصب على العمل والأرباح المادية وينطوي بالغالب على ذاته ولا يصرح بمشاعره بالشكل اللازم وهذا ما يستفز امرأة الحمل التي لا تستطيع التأقلم مع شخصيته على الرغم من أنها تنجذب بداية اليه لثقافته وعقلانيته الا أن هذا ليس كافيا للارتباط وتكوين الأسرة لكنه كافٍ لاقامة علاقة صداقة جيدة تجمعهما.",
                "80"));
        list10.add(new Compatibility("علاقتهما تتميز بالهدوء والانسجام والتفاؤل، أهدافهما واحدة، ينجحان على الصعيدين العملي والعاطفي .. تملك المرأة الثور احساسا دافئا وعفوية لطيفة توقظ الحنان في الرجل الجدي وهذا ما يحتاجه، انها تعرف كيف تحببه الحياة معها، وكيف تدفعه الى ما ترغب به بأسلوبها الغير مباشر لتجد معه السعادة التي تريد، الرجل الجدي يحب بالمرأة الثور الأناقة الى جانب كونها ربة بيت ممتازة، يجدها المرأة المناسبة له واللأئقه به، وهي بالفعل تتمتع بمزايا حميدة أهمها اللطف الاندفاع الثبات وأيضا القوة، إمرأة تقليدية تتميز بالهدوء يغرم بها رجل الجدي ويحاول جاهدا أن يهبها الاستقرار، وكلاهما يرغب بتأسيس عائلة مستقرة، فهما يقدسان الروابط العائلية، هي باستطاعتها تأمين الاستقرار والراحة له وهو يستطيع تأمين كل متطلبات الحياة لها .. السعادة بينهما كاملة، ورغباتهما مشتركة.",
                "80"));
        list10.add(new Compatibility("لا تخلو هذه العلاقة من سوء التفاهم، ينجحان اذا تقبل كل منهما الاخر .. الرجل الجدي يعجب بالمرأة الجوزاء الساعية الى تحقيق ذاتها، وتجذبه عنادة أفكارها، ويحب فيها خصائصها المتناقضة والازدواجية، يسعى الى تملكها والسيطرة عليها  ..المرأة الجوزاء تملك أفكارغنية وكثيرة تستطيع بها مساعدة الرجل الجدي في عمله، تحاول دائما ادخال المرح والخفة الى حياته، وتغرم به لأنه ذلك الرجل الذي تحلم  به، تعشق رصانته .. كليهما يحتاج الى نفس طويلة لفهم الآخر وتقبله، علاقتهما معقولة بشرط أن يأخذا وقتا بالتعارف قبل القيام بأي خطوة مستقبلية.",
                "80"));
        list10.add(new Compatibility("يتشاركان معا الطموح وحب تكوين العائلة، يتحملان المسؤولية ويتقاسمانها سويا، يعيشان علاقة طويلة الأمد .. المرأة السرطان راضية متقبلة للخضوع لسلطة الرجل الجدي وتعامله كسيد المنزل .. أساس علاقتهما هو حب من النظرة الأولى .. هي انسانة رومانسية وحساسة تجاه من تحب، شخصيتها جذابة وغامضة وهي سيدة بيت من الدرجة الأولى، تستطيع الوصول لأهدافها وتحقيق غايتها بمشاركته، أما هو فيتسلط على حياتها ويملكها، انه ينجذب اليها ويتكامل معها، يحب غموضها، وتقربها منه تارة وابتعادها عنه تارة أخرى، وتملك المرأة السرطان عاطفة قوية تساعد فيها الرجل الجدي على إظهار مشاعره، ويمارس هو دوره الذي يحبه كأب ووالد جيد .. يتقبل كل منهما الاخر وينعمان معا بحياة سعيدة ناجحة.",
                "80"));
        list10.add(new Compatibility("علاقتهما غير هادئة، ويوجد صراع شديد بينهما على السيطرة، يتبادلان الاتهامات بشكل مستمر، ولا يتفقان أبدا ..  المرأة الأسد تفتعل المشاكل للرجل الجدي ذو الطابع التقليدي وتخوض معه حرب ضارية للحصول على القيادة والسلطة، تتدخل بكافة أموره وشؤونه وتكره غموضه، تنافسه وتحتد معه، وتسعى دوما لأن تكون هي من يتخذ القرار في المنزل .. الرجل الجدي يهوى بالمرأة الاسد شجاعتها وقوة شخصيتها ويحاول باستمرارالسيطرة عليها الا أنه يفشل فيسبب له ذلك عقدة فيكره المرأة القوية المسيطرة ويبعد عن تفكيره الارتباط بها لأنها لن تكون المرأة التي ستقف بجانبه وتعمل من أجله، يواجهان التحديات الكثيرة ويرفض كلاهما الخضوع للآخر بالرغم من تبادلها الاعجاب.",
                "80"));
        list10.add(new Compatibility("كلاهما من الطبيعة نفسها، يستطيعان فهم بعضهما جيدا، وينجحان على الصعيد العملي .. المرأة العذراء تمتلك كفاءة عملية تجعلها ترفض تفوق الجدي عليها في الاطلاع والمعرفة بالأمور، توجه له الانتقادات المستمرة بسبب اهتمامه المبالغ فيه بالعمل، تراقبه وتكتشف نقاط ضعفه .. أما الرجل الجدي فهو شخص كتوم بطبيعته، لا يستطيع أن يعبر عن مشاعره أو حتى أفكاره، وهو دائم الانشغال بعمله، يحب بالمرأة العذراء ما تتمتع به من شخصية محترمة ووقورة وما تتصف به من تصرفات لبقة وأنيقة، يعجب بمحيطها وبيئتها، ويتقبل مزاجيتها وواقعيتها، لا يتواني عن تشجيعها والوقوف الى جانبها للوصول الى أهدافها، وتحقيق طموحاتها، هو يعلم جيدا أنها امرأة ذكية لكنها لا ترغب في ممارسة الأعمال المنزلية بقدر ما ترغب بالاناقة والرتابة في التصرف، يتميز كلاهما باتقان العمل أكثر من اتقان الحب فلا يستطيع أي منهما التعبير عن مشاعره .. العلاقة تحتاج الى وجود الصراحة، والاندفاع، والحيوية.",
                "80"));
        list10.add(new Compatibility("الانجذاب بينهما مؤقت، العلاقة لا تستمر طويلا ويبتعدان عن بعضهما بسرعة، المرأة الميزان تجذب اليها الرجل الجدي بابتسامتها الساحرة واتزانها، تراه رجلا تقليديا فلا تستطيع الانسجام مع تطلعاته المستقبلية، فتفضل عالمها الخاص الذي تعيشه (عالم الأناقة والجمال) على عالم هذا الرجل (عالم الأفكار والعمل)، علاقتهما غريبة ومجردة، هو ينجذب اليها فتبهره أناقتها، يتقرب ببطىء منها، محاولا التعرف اليها والى عالمها، ليكتشف أن المظاهر الجميلة هي مجرد قناع، وأن العلاقة لن تكون كما يتوقعها، تثير جنونه باسرافها اللامحدود، يبتعد عنها بعد بدء العلاقة بمدة قصيرة لاستخفافها بالأمور الجوهرية التي تهمه ويعدها كأساس لأي علاقة بين اثنين .. الانفصال واقع في هذه العلاقة لا محالة، لكن في كل مرة يلتقيان فيها يشعر قلبيهما بالشوق والانجذاب، الا أنه من غير الممكن أن يصلا الى اتفاق أو تفاهم يجمعهما.",
                "80"));
        list10.add(new Compatibility("علاقة متينة، فكل واحد منهما يحتاج الى الاخر ويحترمه ويقدره، ويمتلك كلاهما من الغموض ما يحفز الآخر لاكتشافه، مما يجعل من علاقتهما علاقة مشوقة وممتعة .. المرأة العقرب تكون مع الرجل الجدي صادقة بشكل تام، تهتم بعلاقتهما، وتتفاهم معه في كافة الأصعدة، مما يجعل العلاقة بينهما غنية .. أما الرجل الجدي فينجذب لتفهم المرأة العقرب له، ويرى فيها المرأة ذات الارادة القوية وصاحبة الشخصية العميقة، التي تتعمق في جميع الاشياء وتفهمها جيدا، يعجب بصراحتها ومشاركتها اهتماماته، يحتاج الى ارادتها وصبرها كثيرا في حياته، يسعى جاهدا لأمتلاكها مهما كلفه الأمر،كلاهما حيويان ورومانسيان كذلك، هو يحترمها ويقدر قيمتها فيمنحها الحب والأمان .. وهي أيضا تحترمه وتقدر مزاياه وطموحه وتشجعه بقوة وتقاسمه الحب وتثق به.",
                "80"));
        list10.add(new Compatibility("ثنائيان قويان، ولكل منهما طبيعة مختلفة عن الاخر، لا يستطيعان التفاهم أو الاتفاق على أي شيء، ويتهربان من مواجهة بعضهما، فلا يعترض أحداهما طريق الآخر .. لا تنجذب المرأة القوس للرجل الجدي فهو برأيها انسان بسيط وجدي ولا يلفت أنظارها، وبالمقارنة باندفاعها وتفاؤلها تجده شخص متشائم، ترغب بأخذ الحرية بدون أية عوائق أو تقاليد قديمة .. الرجل الجدي أيضا لا تجذبه المرأة القوس المتهورة حسب اعتقاده، يعتبر أن عالمها المغامر يمتلىء بالمشاكل والأذية، من المستحيل أن يستطيع امتلاكها، ويفضل الابتعاد عنها.",
                "80"));
        list10.add(new Compatibility("لديهما طموحا وعقلا، ويمتلكان إرادة فولاذية،  ورغبة جامحة في تحقيق الذات، حتى لو تقدم بهما العمر، هما شخصان جادان في عملهما، علاقتهما صامتة، لكن إذا ما حاول أي منهما التخلي عن صمته أصبحت العلاقة حيوية ومثيرة تضمن لهما الوصول الى قمة السعادة، أما إذا تمسكا بالجدية والعمل فقط وأهملا الرومانسية أصبحت العلاقة صعبة ولا فائدة فيها، واذا أرادت المرأة الجدي كسر قلب الرجل الجدي يجب عليها أن تحافظ على العادات القديمة والاهتمام بالمناسبات العائلية، ونصيحة لهذه المراة عليك التخفيف من عنادك حتى تحافظي عليه، وتكسبيه كشريكا يفهم الحياة  .. علاقتهما جدية وعملية.",
                "80"));
        list10.add(new Compatibility("العلاقة في بداياتها جميلة، الا أنهما يبتعدان عن بعضهما بعد ذلك، يعجب كل منهما بالاخر لكنهما يختلفان على كل شيء .. الرجل الجدي يجدها إمرأة ممتعة وصديقة أكثر من رائعة، معها لا يمكنه الشعور بالملل أبدا، لأنه وباستمرار يوجد شيء جديد ومثير من شأنه أن  يجذبه اليها، هي انسانة مميزة لكنها ليست الحبيبة الملائمة له، لأنها امرأة مستقلة لا يمكنها التغيير من نفسها لارضاء الرجل الجدي .. المرأة الدلو لا تقف عند دورها كأنثى فهي تمتلك قدرات ذاتية تسعى لإثباتها، وتبقى ورائها حتى اخر نفس، تلاقي تشجيعا كبيرا من قبل الرجل الجدي الذي يدعمها ويساعدها ويدفعها لتحقيق ذاتها، الا أنها تلاحظ وبشكل سريع محاولاته في السيطرة عليها وامتلاكها، فتبتعد عنه ولا تعطيه الحب والأمان، بل وتفضل أن تعيش وحيدة طوال حياتها على أن تعيش تحت سيطرة رجل يحد من حريتها .. كل منهما يسعى لتحقيق ذاته، لا يناسبا بعضهما برغم الانجذاب الذي يقع بينهما في البداية.",
                "80"));
        list10.add(new Compatibility("علاقتهما تبدأ غالبا بكتابة الرسائل العديدة لبعضهما، فيتعلق كلاهما بالاخر، الا أنهما يخفيان مشاعرهما .. الرجل الجدي يقدم المساعدة للمرأة الحوت، وينقذها من العواصف المتصادمة التي تواجهها، يسيطر عليها ويتحكم بحياتها، وتكون سعيدة وراضية بذلك، تأخذه الى أعماقها وتغوص معه في عالم مليء بالسعادة والحب والأمل، يجدها مشعة على حياته مضيئة لها، فيعيش معها سعيدا .. المرأة الحوت تذهب دائما الى الأعماق،  ومن القليل جدا أن تأتي إلى شاطئ هذا الرجل، فتجعله بشوق دائم إليها، تعجب بطموحه وثباته وشخصيته المستقرة، تعشقه وترتاح إليه، تراه رجل أحلامها، فهو يملك القوة والعاطفة والرجولة معا.",
                "80"));

        list11.add(new Compatibility("ينجحان بشكل كبير كصديقين مقربين علاقتهما خيالية هادئة تتميز بالاثارة تنجذب فيها امرأة الجدي للرجل الدلو لامتلاكه أفكار غريبة وشخصية قوية ويعجبه بها شخصيتها القوية الحالمة القادرة على النجاح بتفوق وتوفير كل ما يلزمها يشترك كلاهما بامتلاك شخصية تتميز بالفضول والاندفاعية والتنوع يشعران بالتكامل معا الا أن تهرب الدلو من حمل المسؤولية يزعج المرأة الحمل كثيرا لذلك فنادرا ما تنجح علاقتهما كزوجين.",
                "80"));
        list11.add(new Compatibility("لا يوجد أي إنسجام أو تناغم في علاقتهما، المرأة الثور تقوم بمساندة الرجل الدلو في تفاصيل حياته كلها وتتوقع منه أن يعطيها مقابلا لما تقدمه الا أنها تتفاجيء بالعكس.. انها تحلم بتحقيق الاستقرار والتملك والسيطرة أما هو فيعيش وسط أحلام كثيرة يحلم بتحقيقها، انه يكره الروتين والتسلط ويحاول دائما الهرب منهما .. العلاقة ممكنة اذا قام أحدهما بالتنازل للاخر لو قليلا.",
                "80"));
        list11.add(new Compatibility("هناك علاقة من التناغم والانسجام على المدى الطويل .. معا يجدان العاطفة الملهمة والصداقة المتينة و ينجحان على الصعيد العملي، علاقة ازدهار وتطور تجمعهما، يبدي كل منهما الرغبة والميول في تقديم المساعدات الاجتماعية ويتعاونا سويا في سبيل بث السعادة في قلوب الآخرين، يجمعهما التفاني وحب التضحية، ويكرسا كافة طاقاتهما في سبيل القيام بالعمل الانساني، انهما صديقان متميزان، هي تستطيع أن تتأقلم بسهولة في محيطه وأجوائه لكنها تثيرغيرته من غير قصد الا أنه يصبرعليها ويسامحها ويرضى عنها فهي شريكة خفيفة الظل مضحكة باعثه في نفسه سعادة وأملا كبيرين، العلاقة اجتماعية جدا، لكنهما يفتقدا الى التنظيم  والترتيب في حياتهما الخاصة، والسبب أنهما يوظفان كافة طاقاتهما خارجها." ,
                "80"));
        list11.add(new Compatibility("علاقة تقوم على الانسجام اذا ابتعد فيها الشريكان عن الغيرة .. المرأة السرطان ترضى بصرفاته الغريبة بعقلانية ووعي .. انها معجبة بمزاجه واستقلاليته خاصة أنه يعرف الطريقة التي يسعدها بها، لكن يتوجب عليها أن تكون انسانة لينة جدا معه ومتفهة لغرابة افكاره .. الرجل الدلو انسان متقلب المزاج يندهش بشجاعة وسخاء المرأة الأسد، ويحس تجاهها بالانجذاب السريع، ويكون في غاية الصراحة معها لأنه يدرك أنها انسانة  ذكية وتملك ثقة كبيرة بذاتها فلا مجال للكذب معها أو الاحتيال عليها، لا يمكنه اخفاء مشاعره عندما تصراحه المرأة الاسد بحبها... يلائم كل منهما الاخر كزوجين وحبيبين وصديقين.",
                "80"));
        list11.add(new Compatibility("علاقة منسجمة في كافة المجالات اذا ابتعدا عن الغيرة .. المرأة الأسد تتقبل تصرفات الرجل الدلو الغريبة بعقلانية لأنها معجبة بمزاجه واستقلاليته فهو يعرف تماما  كيف يسعدها، لكن يتوجب عليها أن تكون لينة أكثر معه وتتفهم أفكاره الغريبة .. يلائمان بعضهما البعض في الزواج والحب والصداقة ..  الرجل الدلو شخص متقلب المزاج تسحره المرأة الأسد بشجاعتها وسخائها، ويشعر بالانجذاب الكبير لها ويكون معها صريح جدا لأنه يعلم تماما كم هي انسانة ذكية وواثقة من نفسها لذلك لا مجال للكذب أو التمثيل عليها،انه لا يستطيع اخفاء حبه لها اذا صارحته هي بحبها.",
                "80"));
        list11.add(new Compatibility("علاقتهما ناجحة ومن الممكن أن تتطور الى الزواج اذا رغبت العذراء بذلك ..  تحمل المرأة العذراء اعجابا شديدا بالرجل الدلو لكنها تنزعج من بعض التصرفات الغريبة لديه، تراقبه وتتابعه بدقة، تشبهه بحبها للحرية والاستقلال، وبامكانها أن تعيش حياة  مريحة وسعيدة معه .. الرجل الدلو يقع في غرام العذراء فيحبها ويحترمها ويتعلق بها كثيرا ولا يقف في طريق طموحها، تعجبه ثقتها الكبيرة بذاتها، وصراحتها، وصدقها .. تطور هذه العلاقة بيد العذراء.",
                "80"));
        list11.add(new Compatibility("علاقتهما منسجمة وحيوية، يحترم كل منهما أفكار الاخر فينجحان معا .. المرأة الميزان تظن بأن الرجل الدلو غير واقعي، فتحاول اعادته الى العالم الحقيقي كلما سرح في عالمه الخاص، تعجب بهدوءه، وهو رجل مميز بالنسبة اليها .. لأنه رجلا فيلسوفا ومفكرا وباحثا وحالما،  لا يمكن أن يبوح بحبه، لكنها تشعر بأحاسيسه تجاهها، وليس لديها أية مشكلة في تقبل تصرفاته، وتقلبات مزاجه .. الرجل الدلو يهواها، ويقع تحت تأثير سحرها وجاذبيتها العفوية، يشعر بضعف ارادتها وحاجتها اليه، يرغب بصداقتها لأنها الانسانة الوحيدة التي يمكنها فهمه، والاستماع اليه.",
                "80"));
        list11.add(new Compatibility("علاقة واضحة ومحددة، لا يستطيعان تخطي حدود علاقتهما العملية الناجحة ..المرأة العقرب تسعى للسيطرة على الرجل الدلو لكنها امرأة رومانسية جدا على العكس منه، تكره تهربه أحيانا من الامور الهامة ولا تحب طبعه المتقلب فهو يزعجها ولا يشعرها بالاستقرار، بينهما نقاط تلاقي وافتراق في جميع الأشياء،  الا أن مجالهما محدود ولا يستطيع الرجل الدلو  تخطيه، يعجب بأفكار المرأة العقرب العملية وتلفته ارادتها القوية، ويحب تعمقها في الامور الأمر الذي يوصله الى أهدافه .. يواجه صعوبة كبيرة في ارضاءها ويجدها مخيفة، لا يرتبطان الا بعلاقة عملية لأن الرجل الدلو لا يميل لهذه المرأة عاطفيا.",
                "80"));
        list11.add(new Compatibility("علاقتهما غير ناجحة، فلا يمكن لأحدهما أن يتقبل الاخر في أي مجال من المجالات، أساس علاقتهما يقوم على الصداقة المتينة وليس العشق .. المرأة القوس تنجذب لعالم الفكر الذي يعيشه الرجل الدلو، وبأمكانها مناقشته دون أن تمل من نقاشه أو من كلامه، يتقاسمان معا الافكار والطموحات وكذلك العلاقات الانسانية الاجتماعية، تدرك جيدا أنه الشخص الوحيد الذي ترتاح له، فتقدره وتحترمه .. الرجل الدلو يعجب كثيرا بشخصية المرأة القوس، وينجذب بشكل كبير لأنوثتها وقوتها في الوقت نفسه، لا يسعى لامتلاكها ، ويظل أوفى صديق لها، ولا يفكر بالتخلي عنها، ويتفاهم معها في كافة المجالات.",
                "80"));
        list11.add(new Compatibility("من أهم شروط الاتفاق بين هذين البرجين أن تكون هناك مسافة محددة بينهما.. أما علاقتهما العاطفية فيوضع عليها علامة استفهام، من الممكن للظروف فقط أن تجمعهما معا .. المرأة الجدي تكون في غاية القلق مع هذا الرجل، تنجذب نحوه الا أنه يفتقد للرزانة والإخلاص معها، فتشعر معه بعدم الاستقرار .. أما الرجل الدلو فنادرا ما يشعر بالسعادة مع هذه المرأة، فهو لا يستطيع فهم أحاسيسه ومشاعره، ويعمل على تعقيد الأمور، لا يتمكن من العيش في علاقة حب كاملة لأعتقاده بأن هذه العلاقة ستحد من حريته، هو يريد من المرأة أن تكون صديقة قبل أن تكون حبيبة وزوجة .. لكل شخص منهما اهتمامات ومجالات معينة تجذبه الى عالم الاخر.",
                "80"));
        list11.add(new Compatibility("الصداقة بينهما قوية جدا اما في العلاقة العاطفية فلا يمكننا الا أن نضع علامة استفهام؟ ان تلاقيا وهما شابان من الممكن أن تكون العلاقة بينهما ثابتة، اما ان كانا في مرحلة الرشد فان العلاقة تكون علاقة صداقة أكثر منها حب لكنه يأتي فيما بعد، وان الصداقة بينهما تكون قوية جدا، أما التحول من الصداقة للزواج فهو أمر في غاية الصعوبة لأن لكل منهما قائمة طويلة بالشروط والواجبات التي يفترض على الشريك الالتزام بها.",
                "80"));
        list11.add(new Compatibility("يوجد بينهما شفافية في التعامل، الا أن زواج الماء والهواء أمر في غاية الصعوبة، قد يحدث الانجذاب من جهة واحدة فقط.. الرجل الدلو يحتاج لوجود الكثير من الليونة حتى يتمكن من التفاهم مع المرأة الحوت، يكره حيلها وميلها لاخفاء عددا من الأمور عنه، يمد لها يد المساعدة ويحل مشاكلها، لكنه لا يقبل التنازل عن حريته، لا يمكن لعاطفتها ودموعها التأثير به، فهو يرغب بامرأة عقلانية قبل أن  تكون حساسة وعاطفية، من الصعب عليهما الاتفاق، برغم جمال مناخ علاقتهما .. المرأة الحوت يجب عليها أن تكون متفهمة حتى تستطيع أن تكتشف أعماق الرجل الدلو، وعليها أن تبتعد عن الشك لأن قلب الحوت لا يمكن أن تفوز به من دون اعطاءه الثقة، وأيضا الحرية الكاملة بالتصرف، عندئذ فقط سيقدر لها هذا، ومن المستحيل أن يسيء إليها، فهو ينتظر منها تقديم الحنان والعطاء المجاني، وفي المقابل سيقدم لها الكثير من الاهتمام والحب والرعاية.",
                "80"));

        list12.add(new Compatibility("الانجذاب قوي ولكنه قصير المدى..يتجاوبان خياليا فقط ولكنهما قد يرتبطا رغم كل شي، المرأة الحمل لا تستطيع ان تتقبل الرجل الحوت الاتكالي فهو لا يقوم بواجباته كرجل، نادرا ما يعمل واكثر ما يقوم به هو الغرق في الاوهام والخيال، اذا كانت مرتاحه ماديا تتقبله برحابه بسبب الانجذاب الرجل الحوت تعجبه المرأة الحمل القوية الشجاعة، ينجذب الى عالمها ويكون معها رقيقا يعتمد عليها ماديا، يتهرب من مسؤولياته ويكره التفاصيل التي تفرضها عليه، يتقن تمثيل دوره الذي يريد ويريها الوجه الذي ترغبه فيه.",
                "80"));
        list12.add(new Compatibility("العلاقه بينهما تفاهم وهدوء.. تنجح بسبب التجاوب والتعاون من كلا الطرفين المرأة الثور تمتاز بالجمال والانوثة والكمال والحب والصبر والتسامح وطيبة القلب.. الصفات التي تجعل الرجل الحوت ينجذب لها.. حياتهما تمتاز بالافكار المتجاوبة .. لا مكان للحقد والكراهية.. ينجذبان الى بعضهما بشدة مما يساعد على حل الكثير من المشاكل علاقة مثمرة ناجحة وسعيدة.",
                "80"));
        list12.add(new Compatibility("لا انسجام ولا توافق، الطبيعتان مختلفتان كليا المرأة الجوزاء تعتبر ان الرجل الحوت يعيش من خلال قلبه وعاطفته الرومنطقية وتراه ساذج وضعيف الارادة ولا يرضيها ان تعيش مع شخص اسير عواطفه الرجل الحوت يخيفه ان يعيش مع امراة تتمتع بحيوية فائقة وحركة دائمة هي تحلم برجل مثالي يرضي أفكارها وهذا ما يفتقر اليه الرجل الحوت المتشائم وهو يعيش في صراع داخلي بين حبه لها وعدم استطاعته لمجاراتها.",
                "80"));
        list12.add(new Compatibility("المرأة السرطان والرجل الحوت علاقة تآلف وإنسجام في جميع الأصعده طابعها الحب والحنان المرأة السرطان تعتبرالرجل الحوت هو الرجل المثالي الذي يعيش في خاطرها واحلامها الوردية تجده انسان لطيف ومهذب، يقدرها ويحب ما تحبه ويرغب ما ترغبه، باستطاعتها ان تحتويه وتغمره بحنانها الكبير، معه تجد سعادة دائمة ومستقرة وهادئة الرجل الحوت لبق التصرف حلو الحديث، ينجذب بسرعة الى عالم المرأة السرطان، هو حنون وعاطفي مثلها، يحب المنزل والعائلة، يلاقي معها الحب والصدر الحنون الرحب.",
                "80"));
        list12.add(new Compatibility("العلاقة تترجمها الأحاسيس القوية، يراعيان شعور بعضهما، المرأة الأسد تعرف كيف تتصرف مع الرجل الحوت، تتدراك الامور بسرعه وتنتشله من الهموم والقلق، ما يعجبها فيه هو حاجته لقوتها في ادراة اموره كما يحلو لها، لا تحاولي السيطره عليه لأنه يكمن حب التملك والسيطرة، كوني رومانطقية معه تكسبينه للأبد فهو العاشق الحالم الذي لن يرفض لك طلبا الرجل الحوت يستقبل المرأة الأسد بالفخامة اللائقة بها رقيق القلب، كريم، حالم وفوضاوي.. تعاليها عليه يزعجه وافتخارها بنفسه يقلقه لكن اساليبها المشجعه له تجعله يدور في فلكها هي قوتها تدفعه الى بعض التصرفات التي تثير غيظها ليتمكن من تحريك شعورها نحوه، هي تغرم به وتحتفظ به الى الأبد.. ولا تبالي بتصرفاته البريئة.",
                "80"));
        list12.add(new Compatibility("العلاقة أجمل ما يمكن ان تكون، هادئة متناغمة ومنسجمة المرأة العذراء تحاول ان تساعد الرجل الحوت في تنظيم اموره، لا تحاول ان تنتقده، تعرف نقاط ضعفه وتستغلها لصالحها، تنجذب اليه وتتأثر بطريقة تعبيره العاطفية، لا تحاولي ان تنتقديه او تجرحي مشاعره لأنه سيرحل دون إنذار، هو يهبها أجمل ما عنده، ويجد معها السعادة، هي تغرم به، تستخرج طاقتها وتنثره على حياتهما، الرجل الحوت مغروم بحياته وأحلامه، يقدر المرأة التي تتفهمه وتقف الى جانبه ومقابل ذلك يمنحها الحب والمساعدة، يعتمد على سحره للتأثير عليها ويتفق معها و يعاملها كأنسانة لها حضورها المميز في حياته وهذا امر هام لن تجديه مع رجل آخر.",
                "80"));
        list12.add(new Compatibility("العلاقة جميلة ورائعة، يفهمان بعضهما ويتقبلان طبيعتهما المختلفة، المرأة الميزان يجذبها الرجل الحوت الحالم اللطيف الشفاف العاشق تحاول ان تفهمه وتتحدث معه بلطافة ناعمة ودافئة بجو رومنطيقي وموسيقي لتؤثر عليه وتوقعه في غرامها، تثق به ولا تحاول السيطرة عليه، هو يجدها أمرأة جذابة وجميله هي تخترق عالمه الغامض وتعيش حياة مفعمة بالتغيير والتناقض والمجهول، انها حياة ممتعة وشيقة الرجل الحوت يحاول ان يجذب انتباه واهتمام المرأة الميزان وعطفها، معجب بها ويظهر ضعفه امامها، يهبها اجمل ما عنده، يشعر نحوها بالأنجذاب، نظراته للعلاقة عميقة ومتفهمة يعاملها كسيدة ويحترمها ويحبها وهذا ما تتمناه معظم النساء.",
                "80"));
        list12.add(new Compatibility("العلاقة منسجمة متآلفة، المرأة العقرب تحاول السيطره عليه وامتلاكه بمزاياها الحسنه وصفاتها الحميدة، تمنحه ثقتها واخلاصها، بأستطاعتها ان تصل الى اعماقه وتتفهم مكامن القوة والضعف فيه، تعرف انه صادق معها ليس خبيث او محتال تضحي من اجله وتطيعه الرجل الحوت يتفق مع المرأة العقرب، يرغب بالمرأة التي تساعده وتقف الى جانبه وتفهمه، يوهمها بانه رجل ضعيف مغلوب على امره يحتاج اليك ليحصل على حبها لكنه لا يتركها تسيطر عليه، معه تجدين الحب والاحترام والتفاني من اجل سعادتك، العلاقه ناجحة يؤسسا بيتا سعيدا وحياة مزدهرة.",
                "80"));
        list12.add(new Compatibility("العلاقة محددة وواضحة منذ البداية، هما صديقان أفضل منهما زوجان وحبيبان، يتفقان في بعض المجالات وهذا يجعل العلاقة بينهما حميمة،المرأة القوس ترغب برجل متفائل، تعتبر الزواج من الحوت سجن مؤبد، لا تستطيع فهمه، لا تعتقدي انه من السهل السيطرة عليه سخريتك منه تجعله ينفر منك ويغوص في الاعماق الرجل الحوت متشائم بطبعه وغيور ومتملك وهذا مالا ترغب به المرأة القوس، يملك قدرة وقوة هائلتين تجذبانك اليه بسهولة، قادر على ان يكون الشخص الذي ترغبين به لكنه غير مستعد للتخلي عن احلامه من اجلك،يتفهمك كأنثى ويعاملك كسيدة وانسانة محترمة ويحبك فقط كصديقة، ينجحان كصديقان ويصطدمان كزوجين.",
                "80"));
        list12.add(new Compatibility("العلاقة جميلة وممتعة ككل علاقة بين ثنائي،وعلاقة الجدي بالحوت لا تشذ عن هذه القاعدة لكن عندما \"تروح السكرة وتأتي الفكرة\" يكتشف كل واحد من قلقه، المرأة الجدي تكتشف انه رجل مزاجي متقلب لا يكمل ما يبدأ به، هذه المرأة تحلم برجل قوي تعجب به، يجذبها غموضه وتتطور العلاقة بينهما الرجل الحوت حنون، حساس حالم،وطريف،يعجب المرأة الجدي ويضفي السعادة والمرح على حياتها التقليدية،تطير في عالم من الأحلام، تدعك تحلق بينما تقف على الأرض بصلابته ثابتة تاركة لك حرية التحليق والعودة متى تشاء، إذا فشلت هذه العلاقة يقع اللوم على المرأة لأنه كان باستطاعتها مساعدة الرجل الحوت والتخفيف كل واحد منهما يريد ان يشعر بانه محبوب ولا يستغني عن الواحد منهما عن الآخر، يكملان بعضهما.",
                "80"));
